import React from "react";

import "../Projects/Projects.css";

import LookingForMaecenas from "../../images/LookingForMaecenas.png";

const Card = (props) => {
  const handleClick = () => {};
  const holdTempClass = "cardBox border-0 ";
  return (
    <div className={holdTempClass + props.name}>
      <div className="content rounded">
        <div className="front rounded">
          <div
            className="frontCard rounded"
            style={{
              backgroundImage: `url(${LookingForMaecenas})`,
              backgroundPosition: "center",
              backgroundRepeat: "no-repeat",
              backgroundSize: "cover",
            }}
          ></div>
        </div>
        <div className="back rounded d-flex justify-content-center align-items-center bg-ligth">
          <div style={{ width: "100%" }}>
            <blockquote class="blockquote p-1">
              <p class="mb-0">Una red Social para el mecenazgo de pueblos</p>
            </blockquote>
            <div>
              <span class="badge badge-secondary mr-1">Mern</span>
              <span class="badge badge-secondary mr-1">Secondary</span>
              <span class="badge badge-secondary mr-1">Secondary</span>
              <span class="badge badge-secondary mr-1">Secondary</span>
              <span class="badge badge-secondary mr-1">Secondary</span>
            </div>

            <div>
              <button type="button" class="btn btn-primary mx-1">
                Primary
              </button>
              <button type="button" class="btn btn-secondary mx-1">
                Secondary
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
